import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { getOrderById } from "../../api/orderApi";
import { getAllUsers } from "../../api/peopleApi";

function Dashboard() {
  const [stats, setStats] = useState({
    totalOrders: 0,
    onlineOrders: 0,
    dineInOrders: 0,
    totalRevenue: 0,
    staffCount: 0
  });

  const MAX_ID = 500;

  useEffect(() => {
    loadStats();
  }, []);

  const loadStats = async () => {
    let totalOrders = 0;
    let onlineOrders = 0;
    let dineInOrders = 0;
    let totalRevenue = 0;

    for (let id = 1; id <= MAX_ID; id++) {
      try {
        const o = await getOrderById(id);
        if (!o) continue;

        totalOrders++;
        totalRevenue += Number(o.orderPrice || 0);

        if (o.tableNo != null) dineInOrders++;
        else onlineOrders++;
      } catch {
        // skip missing
      }
    }

    const users = await getAllUsers();

    setStats({
      totalOrders,
      onlineOrders,
      dineInOrders,
      totalRevenue,
      staffCount: users.length
    });
  };

  const Card = ({ title, value, to }) => (
    <Link to={to} style={{ textDecoration: "none", color: "inherit" }}>
      <div
        style={{
          border: "1px solid #333",
          borderRadius: 8,
          padding: 20,
          minWidth: 220,
          background: "#0f172a"
        }}
      >
        <h4>{title}</h4>
        <h2>{value}</h2>
      </div>
    </Link>
  );

  return (
    <div style={{ maxWidth: 1200 }}>
      <h2>üìä Manager Dashboard</h2>

      {/* ===== STATS ===== */}
      <div
        style={{
          display: "flex",
          gap: 20,
          flexWrap: "wrap",
          marginBottom: 40
        }}
      >
        <Card title="Total Orders" value={stats.totalOrders} to="/orders/all" />
        <Card title="Online Orders" value={stats.onlineOrders} to="/online-orders" />
        <Card title="Dine-In Orders" value={stats.dineInOrders} to="/dine-in-order" />
        <Card title="Total Revenue" value={`${stats.totalRevenue} ‚Ç∫`} to="/orders/all" />
        <Card title="Staff Count" value={stats.staffCount} to="/people" />
      </div>

      {/* ===== QUICK ACTIONS ===== */}
      <h3>‚ö° Quick Actions</h3>

      <div style={{ display: "flex", gap: 15, flexWrap: "wrap" }}>
        <Link to="/items"><button>üì¶ Items</button></Link>
        <Link to="/courses"><button>üçΩÔ∏è Courses</button></Link>
        <Link to="/orders/dine-in"><button>üç¥ Dine-In Orders</button></Link>
        <Link to="/orders/online"><button>üöö Online Orders</button></Link>
        <Link to="/orders/all"><button>üìã All Orders</button></Link>
        <Link to="/people"><button>üë• People</button></Link>
        <Link to="/usage/list"><button>üìä Usage</button></Link>
        <Link to="/usage/list"><button>üóëÔ∏è Waste Report</button></Link>
      </div>
    </div>
  );
}

export default Dashboard;
